Below is a simple JavaScript function that checks if a number is prime. This function, `isPrime`, takes an integer `n` as input and returns `true` if the number is prime and `false` otherwise.

```javascript
function isPrime(n) {
    if (n <= 1) {
        return false;
    }
    for (let i = 2; i * i <= n; i++) {
        if (n % i === 0) {
            return false;
        }
    }
    return true;
}

// Example usage:
console.log(isPrime(5)); // Expected output: true
console.log(isPrime(6)); // Expected output: false
```

This function works by checking each number less than or equal to the square root of `n` to see if it divides `n` evenly. If any such divisor is found, the function immediately returns `false`. If no divisors are found after checking all relevant numbers, the function returns `true`.

If you want a function that generates prime numbers up to a certain limit, here's how you could do it:

```javascript
function generatePrimesUpTo(limit) {
    let primes = [];
    for (let n = 2; n <= limit; n++) {
        let isPrimeFlag = true;
        for (let i = 2; i * i <= n; i++) {
            if (n % i === 0) {
                isPrimeFlag = false;
                break;
            }
        }
        if (isPrimeFlag) {
            primes.push(n);
        }
    }
    return primes;
}

// Example usage:
console.log(generatePrimesUpTo(10)); // Expected output: [2, 3, 5, 7]
```

However, for generating primes up to a large limit more efficiently, you would typically use the Sieve of Eratosthenes algorithm, which has better performance characteristics for large ranges.
